import CartActionTypes from "../cart-types.js"

export const addItem = (item) => ({
    type: CartActionTypes.ADD_ITEM,
    payload: item
})

export const addItemStart = (item) => ({
    type: CartActionTypes.ADD_ITEM_START,
    payload: item
})
